import React, { useState } from "react";

export default function Todolist() {
  const [items, setitems] = useState([]);
  const [inputlist, setinputlist] = useState("");
  const listOfItems = () => {};
  const itemEvent = (e) => {
    setinputlist(e.target.value);
  };
  return (
    <div className="todoContainer">
      <input placeholder="Input your TOdo" onChange={itemEvent}></input>
      <button onClick={listOfItems}>Add your Todo</button>
      <ul>
        <li>{inputlist}</li>
        {items.map((itemsList) => {
            return(
                <div>{itemsList}

                </div>
            )

        })}
      </ul>
    </div>
  );
}
